        content:
          '<p>&nbsp; &nbsp; &nbsp; &nbsp;苏美达国际技术贸易有限公司（以下简称“公司”）成立于1999年3月，是苏美达股份有限公司(股票代码600710)的核心骨干企业，隶属于世界五百强、中央直接管理的核心骨干企业——中国机械工业集团有限公司。公司注册资本5.6亿元，总部位于江苏南京，在迪拜、新加坡、越南、香港、北京、上海、成都、重庆、广州、海口、厦门、镇江、无锡等地共有20余家全资及控股子公司。<br>&nbsp; &nbsp; &nbsp; &nbsp;公司主要从事纺织、轻工、机床、冶金、电子、新能源、医疗等高端机电设备和钢铁、煤炭、矿产、建材、石油化工品等大宗商品的国内外供应链运营。<br>&nbsp; &nbsp; &nbsp; &nbsp;在装备领域，公司致力于成为全国领先的机电产品进出口供应链服务提供商，提供国际招标、金融服务、商务手续代办、贸易代理、报关、商检运输、保险等全流程、端到端的供应链解决方案。帮您一站式解决产品选购及销售（进口，出口，内贸）、设备招标、金融方案、降低物流成本、售后维保等问题。<br>&nbsp; &nbsp; &nbsp; &nbsp;依托多年发展形成的产业资源渠道和供应链组织与整合能力，为海内外客户提供“资源供应、商务咨询、金融支持、物流服务”四位一体的供应链集成服务，现已形成年营业收入超1000亿元、进出口总值超100亿美元的发展规模，成为国内领先的机电设备进口供应链服务商和大宗商品供应链综合运营商。作为全国首批供应链创新与应用示范企业、江苏省服务贸易重点企业和江苏省内外贸一体化试点企业，公司已连续多年位居全国一般贸易进口企业百强、出口企业百强，连续十余年位居南京海关关区进出口前列，连续十余年获评全国十大招标机构。<br>&nbsp; &nbsp; &nbsp; &nbsp;公司秉持“客户至上、诚信为本、创新超越、行稳致远”的核心价值观，胸怀“做现代服务业的领先者和实体经济发展的助力者”的发展使命，以“矢志成为利益相关者信赖的国际化一流企业”为发展愿景，努力为客户提供增值服务，为员工构建发展平台，为股东创造更多财富，为社会承担更大责任。</p>',
