        content:
          '<p>塑造成形的未来<br>我们的使命:&nbsp;<br>为移动出行和工业领域生产智能定制机器和部件，以使其强大和具有竞争力。<br>Felss集团是一家管材和棒材冷成型领域的解决方案提供商。我们在整个价值链上为客户提供支持——从图纸到成品部件甚至更广。我们有800多名员工与客户以及合作伙伴一起合作、共同面对未来的挑战，在德国、瑞士、斯洛伐克、美国和中国建有工厂和办事处。<br>从1973年开始，Felss Systems GmbH就已经作为Felss集团的一个机械工程部门开始运行，位于德国Koenigsbach Stein，这也是Felss集团的所在地。Felss Systems GmbH专注于设备的生产、技术和工艺的开发以及轻量化产品冷成型工艺的创新。这里也是服务部门的起源地。<br>Rotaform GmbH成立于1988年，是一家专业从事部件生产的公司，顺应市场上对旋锻零件持续增长的订购需求。起初该分公司也在Koenigsbach Stein，后来因发展比较稳定于1988年又在Bretten Goelshausen新建了一个工厂。Felss Rotaform工厂专门生产轻量化的零部件。服务范围从产品打样延伸到批量化生产成品零部件。<br>1986年，Felss Rotaform AG在瑞士成立。在Felss集团的历史上，第一次向整个欧洲供应旋锻工艺制造的零部件。从那时起，工厂实现了最高水平的零部件生产，这得益于我们核心技术中的专有技术和我们自己的模具制造部门。<br>Felss Rotaform LLC成立于1999年，位于美国威斯康星州，是德国Felss Group GmbH的子公司。自成立以来，Rotaform LLC逐步发展成为美国领先的冷成型部件制造商之一。<br>2017年，Felss Rotaform S.R.O.作为德国Felss Group GmbH的子公司在斯洛伐克成立。这家位于Ilava的工厂属于Felss集团的零件制造部门，使用冷成型技术为移动出行和工业生产领域提供了范围广泛的零部件。<br>自2019年以来，HMP（全称Heinrich Müller Pforzheim）成为了Felss集团的一部分，总部位于Königsbach-Stein。HMP被视为轧制技术的专家，他带来的新技术扩展了Felss集团的产品范围。HMP轧制技术被整合在Felss集团中，并以HMP辊轧品牌运营。</p><figure class="table" style="width:525.02pt;"><table><tbody><tr><td style="height:30.00pt;width:219.25pt;">公司名称（中文）</td><td style="width:306.00pt;">菲尔斯</td></tr><tr><td style="height:30.00pt;width:219.25pt;">公司名称（英文）</td><td>Felss Systems GmbH&nbsp;</td></tr><tr><td style="height:30.00pt;width:219.25pt;">公司所属国家/地区</td><td>德国</td></tr><tr><td style="height:44.50pt;width:219.25pt;">公司业务类型（原厂、代理商）</td><td>原厂</td></tr><tr><td style="height:30.00pt;width:219.25pt;">主营产品（列举3个以内）</td><td>旋锻机，精密轴向成形设备，轧机</td></tr><tr><td style="height:53.15pt;width:219.25pt;">所属行业</td><td>机械加工</td></tr><tr><td style="height:30.00pt;width:219.25pt;">公司人数</td><td>750人</td></tr><tr><td style="height:30.00pt;width:219.25pt;">主营业务收入</td><td>约1.6亿欧元</td></tr><tr><td style="height:30.00pt;width:219.25pt;">公司成立时间</td><td>1905</td></tr><tr><td style="height:30.00pt;width:219.25pt;">与苏美达合作时长</td><td>超过10年</td></tr><tr><td style="height:30.00pt;width:219.25pt;">已有产品认证</td><td>ISO 9001; ISO 14001; ISO 50001</td></tr><tr><td style="height:30.00pt;width:219.25pt;">已获得的专利</td><td>超过20种冷成形专利</td></tr><tr><td style="height:30.00pt;width:219.25pt;">注册商标</td><td>Felss，HMP</td></tr><tr><td style="height:30.00pt;width:219.25pt;">主要市场分布</td><td>欧洲，美国，中国</td></tr></tbody></table></figure><figure class="table" style="width:525.02pt;"><table><tbody><tr><td style="height:30.00pt;width:219.25pt;">工厂所在地</td><td style="width:306.00pt;">75203 Koenigsbach-Stein, 德国</td></tr><tr><td style="height:30.00pt;width:219.25pt;">研发人员数量</td><td>11</td></tr><tr><td style="height:30.00pt;width:219.25pt;">生产线数量</td><td>20</td></tr><tr><td style="height:47.50pt;width:219.25pt;">主营产品年产量</td><td>每年70-100台设备</td></tr></tbody></table></figure><figure class="table" style="width:525.02pt;"><table><tbody><tr><td style="height:30.00pt;width:219.25pt;">使用语言</td><td style="width:306.00pt;">汉语，德语，英语</td></tr><tr><td style="height:30.00pt;width:219.25pt;">平均交货时间</td><td>设备：6-12个月; 打样8-12周</td></tr><tr><td style="height:30.00pt;width:219.25pt;">可接受的贸易条款</td><td>EXW, FCA factory Pforzheim, CIF, CPT,其他</td></tr><tr><td style="height:30.00pt;width:219.25pt;">可接受的付款货币</td><td>欧元或人民币</td></tr><tr><td style="height:30.00pt;width:219.25pt;">可接受的付款方式</td><td>TBD</td></tr></tbody></table></figure>',
