          '<p>本公司是专业经营国内外数控机床，已进口设备为主！</p><p>本公司核心价值观是以客户为导向， 服务至上、品质为先、交钥匙工程、视为公司经营理念！</p><p>公司秉承“顾客至上、诚信践诺、薄利多销、承担责任、使命必达”的经营理念，以“顾问式销售、网络化服务”的销售模式为您服务。</p><p>公司核心经营模式：交钥匙工程项目！</p><p>且并配备有专业工艺工程师、项目经理、服务工程师、验收工程师！在选机型号、加工工艺方面有独特的专业优势。</p><p>公司追求成为“ 为用户追求高效率提供完整解决方案的供应商” 。</p><p>&nbsp; &nbsp;“诚信为本、产品过硬、互惠互利， &nbsp;共同发展”的企业精神使我公司自成立以来， &nbsp;成为华东、东北、华南等地区机 加工企业及各大销售企业的优秀供货商。</p><p>目前公司技术方案人员4 人，专职工艺方案制作， &nbsp;包括刀具选 &nbsp; 型、夹具设计、参数初定等；项目经理4 人，主要负责不同区域客户销售；</p><p>服务及应用工程师6 人，主要职责在项目售前售后服务， 以及验收过程中应用， &nbsp;如编程、操作机器、加工参数核实、夹具体与 刀具干涉模拟等！</p><figure class="table"><table><tbody><tr><td>公司名称（中文）</td><td>南京新铠航机电设备有限公司</td></tr><tr><td>公司所属国家/地区</td><td>江苏南京</td></tr><tr><td>公司业务类型</td><td>代理商</td></tr><tr><td>主营产品</td><td>机电设备、数控机床、工业自动化成套控制装置研发、控制设备销售、刀具、五金、机械设备销售</td></tr><tr><td>所属行业</td><td>工程机械</td></tr><tr><td>公司人数</td><td>20人</td></tr><tr><td>主营业务收入</td><td>三千万</td></tr><tr><td>公司成立时间</td><td>2015年2月9日</td></tr></tbody></table></figure>',
