        content:
          '<p>在40多年前的1974年，ANCA的创始人Pat McCluskey和Pat Boland以4000美元的价格购买了一台迷你电脑。他们最初的想法是用标准计算机替换当时的硬连线控制系统。将计算机添加到数控（NC）系统中，从而实现计算机数控（CNC）系统，这项技术比当时的硬布线逻辑设计更强大更灵活。<br>如今，ANCA已成为一家蓬勃发展的跨国企业，拥有1,000多名员工，是世界领先的数控刀具磨床，数控系统和钣金加工制造商。ANCA全球总部仍位于澳大利亚的墨尔本，但产品已遍布世界各地。服务于刀具行业的利基市场，我们99％的产品出口至全球45个国家。分公司遍及英国，德国，中国，泰国，印度，日本，巴西和美国。另外还拥有遍布全球的代理和代理商网络。</p><figure class="table" style="width:489pt;"><table><tbody><tr><td style="height:30.0pt;width:219pt;"><p style="text-align:center;">公司名称（中文）</p></td><td style="border-left-style:none;width:270pt;"><p style="text-align:center;">昂科机床（上海）有限公司</p></td></tr><tr><td style="border-top-style:none;height:30.0pt;"><p style="text-align:center;">公司名称（英文）</p></td><td style="border-left-style:none;border-top-style:none;"><p style="text-align:center;">ANCA Group</p></td></tr><tr><td style="border-top-style:none;height:30.0pt;"><p style="text-align:center;">公司所属国家/地区</p></td><td style="border-left-style:none;border-top-style:none;"><p style="text-align:center;">澳大利亚</p></td></tr><tr><td style="border-top-style:none;height:30.0pt;"><p style="text-align:center;">公司业务类型</p></td><td style="border-left-style:none;border-top-style:none;"><p style="text-align:center;">原厂</p></td></tr><tr><td style="border-top-style:none;height:30.0pt;"><p style="text-align:center;">主营产品</p></td><td style="border-left-style:none;border-top-style:none;"><p style="text-align:center;">数控刀具磨床，数控系统，钣金加工设备</p></td></tr><tr><td style="border-top-style:none;height:30.0pt;"><p style="text-align:center;">所属行业</p></td><td style="border-left-style:none;border-top-style:none;"><p style="text-align:center;">机械加工</p></td></tr><tr><td style="border-top-style:none;height:30.0pt;"><p style="text-align:center;">公司成立时间</p></td><td style="border-left-style:none;border-top-style:none;text-align:right;"><p style="text-align:center;">1974年</p></td></tr></tbody></table></figure>',
